import React from 'react';
import PropTypes from 'prop-types';
import { useTheme } from '@mui/material/styles';

const Webbee = ({ width = 45, height = 70 }) => {
  const theme = useTheme();
  const colorPrimaryMain = theme.palette.primary.main;
  const colorPrimaryDark = theme.palette.primary.main;
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width={width}
      height={height}
      fill="none"
      viewBox="0 0 95 71"
    >
      <rect
          x="100"
          y="100"
          width="400"
          height="200"
          fill="blue"
          stroke="black"
          stroke-width="5"
        />

        <path
          fill="#000000"
          opacity="1.000000"
          stroke="none"
          d="
            M634.019775,479.105347
            C616.401855,492.076019 608.532410,509.725769 607.758240,530.768799
            C607.260315,544.304260 599.936401,558.075806 588.671326,559.339172
            z"
        />
      </svg>

      );
      };

      Webbee.propTypes = {
      width: PropTypes.oneOfType([PropTypes.number, PropTypes.string]),
      height: PropTypes.oneOfType([PropTypes.number, PropTypes.string]),
    };

      export default Webbee;
